import { Link } from 'react-router-dom';

const Navbar = () => (
  <nav className="bg-clippersBlue text-clippersWhite w-64 h-screen p-4 flex flex-col">
    <h1 className="text-xl font-bold mb-8">LA Clippers Showcase</h1>
    <div className="space-y-4">
      <Link to="/" className="block hover:underline">Home</Link>
      <Link to="/team" className="block hover:underline">Team</Link>
      <Link to="/league" className="block hover:underline">League</Link>
    </div>
  </nav>
);

export default Navbar;
